{id:6602,question:"निम्नलिखित में से किस राज्य ने 15वीं हॉकी इंडिया सीनियर मेन नेशनल चैंपियनशिप 2025 जीती?",options:["A) पंजाब","B) हरियाणा","C) उत्तर प्रदेश","D) राजस्थान","E) अनुत्तरित प्रश्न"],answer:"A) पंजाब"},
{id:6603,question:"2025 में भारत के 76वें गणतंत्र दिवस समारोह के मुख्य अतिथि कौन थे?",options:["A) इमैनुएल मैक्रों","B) प्रबोवो सुबियांटो","C) अब्देल फत्ताह अल-सीसी","D) जोको विडोडो","E) अनुत्तरित प्रश्न"],answer:"B) प्रबोवो सुबियांटो"},
{id:6604,question:"अंतर्राष्ट्रीय अंतरिक्ष स्टेशन पर जैविक अनुसंधान करने के लिए शुभांशु शुक्ला सहित अंतरिक्ष यात्रियों को अंतरिक्ष में (जून 2025 में) लॉन्च करने के लिए उपयोग किए जाने वाले अंतरिक्ष यान का नाम बताइए। (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) अपोलो 11","B) वोस्तोक 1","C) एक्सिओम 4","D) स्पेसबॉल ।","E) अनुत्तरित प्रश्न"],answer:"C) एक्सिओम 4" , deleted: true},
{id:6605,question:"ऑपरेशन \"सिंदूर” में किस स्वदेशी मिसाइल प्रणाली ने शानदार प्रदर्शन किया?",options:["A) पृथ्वी","B) आकाश","C) अग्नि","D) ब्रह्मोस","E) अनुत्तरित प्रश्न"],answer:"D) ब्रह्मोस"},
{id:6606,question:"\"शिरुई लिली महोत्सव-2025\" किस भारतीय राज्य में मनाया गया?",options:["A) नागालैंड","B) असम","C) मणिपुर","D) मेघालय","E) अनुत्तरित प्रश्न"],answer:"C) मणिपुर"},
{id:6607,question:"इंडिया स्किल्स रिपोर्ट-2025 के अनुसार महिलाओं को रोजगार संसाधन उपलब्ध कराने के मामले में राजस्थान का कौन-सा स्थान है?",options:["A) प्रथम","B) द्वितीय","C) तृतीय","D) चतुर्थ","E) अनुत्तरित प्रश्न"],answer:"A) प्रथम"},
{id:6608,question:"जून 2025 में राजस्थान की निम्नलिखित में से किस आर्द्रभूमि को रामसर साइट घोषित किया गया है?",options:["A) देवीकुंड, बीकानेर","B) डीडवाना, नागौर","C) मेनार, उदयपुर","D) बड़ा तालाब, अजमेर","E) अनुत्तरित प्रश्न"],answer:"C) मेनार, उदयपुर"},
{id:6609,question:"राजस्थान की किस झील का नाम बदलकर वरुण सागर झील रखा गया है?",options:["A) नक्की झील","B) समन्द झील","C) फॉय सागर झील","D) कायलाना झील","E) अनुत्तरित प्रश्न"],answer:"C) फॉय सागर झील"},
{id:6610,question:"राजस्थान के किस शहर में \"राष्ट्रीय सहकार मसाला मेला-2025\" आयोजित किया गया?",options:["A) अलवर","B) जयपुर","C) भीलवाड़ा","D) जैसलमेर","E) अनुत्तरित प्रश्न"],answer:"B) जयपुर"},
{id:6611,question:"निम्नलिखित में से कौन-सा क्षेत्र राजस्थान के दक्षिण-पूर्वी मैदान (हाड़ौती पठार) से संबंधित है? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) बारां","B) सिरोही","C) अजमेर","D) अलवर","E) अनुत्तरित प्रश्न"],answer:"A) बारां"},
{id:6612,question:"राजस्थान की रेगिस्तानी मिट्टी में निम्नलिखित में से कौन-सा तत्व उच्च मात्रा में पाया जाता है? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) कार्बनिक पदार्थ","B) कैल्सियम कार्बोनेट","C) पोटेशियम","D) मैग्नीशियम","E) अनुत्तरित प्रश्न"],answer:"B) कैल्सियम कार्बोनेट"},
{id:6613,question:"भारत की जनगणना (2011) के अनुसार राजस्थान के किस जिले में ग्रामीण जनसंख्या का प्रतिशत (शहरी जनसंख्या के मुकाबले) सबसे अधिक था?",options:["A) डूंगरपुर","B) झालावाड़","C) पाली","D) जैसलमेर","E) अनुत्तरित प्रश्न"],answer:"A) डूंगरपुर"},
{id:6614,question:"राजस्थान में गर्मियों के दौरान चलने वाली गर्म, शुष्क और धूल भरी हवाओं के लिए निम्नलिखित में से किस शब्द का उपयोग किया जाता है? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) मावठ","B) काटाबेटिक","C) लू","D) मानसून","E) अनुत्तरित प्रश्न"],answer:"C) लू"},
{id:6615,question:"केवलादेव घाना राष्ट्रीय उद्यान निम्नलिखित में से किस क्षेत्र में स्थित है?",options:["A) कोटा","B) सवाई माधोपुर","C) भरतपुर","D) बारी","E) अनुत्तरित प्रश्न"],answer:"C) भरतपुर"},
{id:6616,question:"निम्नलिखित में से कौन-सा क्षेत्र राजस्थान में टॉडगढ़-राओली वन्यजीव अभयारण्य से सम्बंधित नहीं है?",options:["A) राजसमंद","B) अजमेर","C) पाली","D) झुंझुनू","E) अनुत्तरित प्रश्न"],answer:"D) झुंझुनू"},
{id:6617,question:"निम्नलिखित में से राजस्थान की सबसे बड़ी कृत्रिम झील कौन-सी है?",options:["A) लूणकरणसर","B) सांभर","C) जयसमंद","D) पचपदरा","E) अनुत्तरित प्रश्न"],answer:"C) जयसमंद"},
{id:6618,question:"भारत के संविधान का निम्नलिखित में से कौन-सा अनुच्छेद भारत के क्षेत्र में कानून के समक्ष समानता और कानूनों के तहत समान सुरक्षा सुनिश्चित करता है?",options:["A) अनुच्छेद 17","B) अनुच्छेद 52","C) अनुच्छेद 14","D) अनुच्छेद 32","E) अनुत्तरित प्रश्न"],answer:"C) अनुच्छेद 14"},
{id:6619,question:"भारत में राज्य मंत्रियों के वेतन और भत्ते का कानूनी तौर पर निर्धारण करने का अधिकार किसके पास है?",options:["A) भारत के राष्ट्रपति","B) संबंधित राज्य के राज्यपाल","C) राज्य विधानमंडल","D) संसद","E) अनुत्तरित प्रश्न"],answer:"D) संसद"},
{id:6620,question:"भारत में राज्यों के ज़िलों में निचली अदालतें ______ के सीधे अधीक्षण में कार्य करती हैं।",options:["A) संसद","B) उच्च न्यायालय","C) भारत के राष्ट्रपति","D) सर्वोच्च न्यायालय","E) अनुत्तरित प्रश्न"],answer:"B) उच्च न्यायालय"},
{id:6621,question:"निम्नलिखित में से राजस्थान उच्च न्यायालय के पहले मुख्य न्यायाधीश कौन थे?",options:["A) न्यायमूर्ति नवल किशोर","B) न्यायमूर्ति के. एल. बापना","C) न्यायमूर्ति अमर सिंह","D) न्यायमूर्ति कमला कांत वर्मा","E) अनुत्तरित प्रश्न"],answer:"D) न्यायमूर्ति कमला कांत वर्मा"},
{id:6622,question:"राजस्थान सरकार के अंतर्गत गृह रक्षा विभाग के कैबिनेट मंत्री कौन हैं (जून 2025 के अनुसार)?",options:["A) बाबू लाल खराड़ी","B) सुरेश सिंह रावत","C) अविनाश गहलोत","D) किरोड़ी लाल","E) अनुत्तरित प्रश्न"],answer:"A) बाबू लाल खराड़ी"},
{id:6623,question:"राज्य विधान सभा के अध्यक्ष अपना इस्तीफा ______ को सौंपते हैं।",options:["A) राज्यपाल","B) मुख्यमंत्री","C) उस विधान सभा के उपाध्यक्ष","D) राज्य उच्च न्यायालय के मुख्य न्यायाधीश","E) अनुत्तरित प्रश्न"],answer:"C) उस विधान सभा के उपाध्यक्ष"},
{id:6624,question:"निम्नलिखित में से वह महत्वपूर्ण शासक कौन थे जिसे चित्तौड़ में गुहिल राजवंश की पुनः स्थापना का श्रेय दिया गया?",options:["A) राणा हम्मीर","B) जैत्र सिंह","C) रतन सिंह","D) महाराणा लाखा","E) अनुत्तरित प्रश्न"],answer:"A) राणा हम्मीर"},
{id:6625,question:"1857 में नसीराबाद छावनी में सैनिकों ने निम्नलिखित में से किस तारीख को विद्रोह किया?",options:["A) 28 मई","B) 28 अप्रैल","C) 28 मार्च","D) 28 फरवरी","E) अनुत्तरित प्रश्न"],answer:"A) 28 मई"},
{id:6626,question:"30 मार्च, 1949 को गठित वृहत् राजस्थान के प्रथम मंत्रिमंडल का नेतृत्व किसने किया?",options:["A) गोकुल लाल असावा","B) माणिक्य लाल वर्मा","C) भूपाल सिंह","D) हीरालाल शास्त्री","E) अनुत्तरित प्रश्न"],answer:"D) हीरालाल शास्त्री"},
{id:6627,question:"राजस्थान के वह प्रसिद्ध व्यक्ति जिन्होंने \"लीलटांस (कविता)\" लिखी थीः",options:["A) विजयदान देtha","B) बावजी चतुर सिंहजी","C) गौरीशंकर हीराचंद ओझा","D) कन्हैयालाल सेठिया","E) अनुत्तरित प्रश्न"],answer:"D) कन्हैयालाल सेठिया"},
{id:6628,question:"निम्नलिखित में से कौन सी सूर्यमल मिश्रान की प्रसिद्ध साहित्यिक कृति है?",options:["A) वंश भास्कर","B) पृथ्वीराज राव","C) अमोलक बातां","D) बातां री फुलवारी","E) अनुत्तरित प्रश्न"],answer:"A) वंश भास्कर"},
{id:6629,question:"राजस्थानी उपन्यास \"धोरां रो धोरी\" के लेखक का नाम बताइए।",options:["A) लक्ष्मी कुमारी चुण्डावत","B) यादवेंद्र शर्मा","C) श्रीलाल नथमल जोशी","D) रामेश्वर दयाल श्रीमाली","E) अनुत्तरित प्रश्न"],answer:"C) श्रीलाल नथमल जोशी"},
{id:6630,question:"यदि किसी राशि पर 7% वार्षिक दर से दूसरे वर्ष में अर्जित चक्रवृद्धि ब्याज ₹15,729 है, तो राशि है :",options:["A) ₹2,08,215","B) ₹2,09,280","C) ₹2,10,000","D) ₹2,12,355","E) अनुत्तरित प्रश्न"],answer:"C) ₹2,10,000"},
{id:6631,question:"विनय ने कुल ₹25,000 की राशि का कुछ भाग साधारण ब्याज पर और शेष भाग चक्रवृद्धि ब्याज पर निवेश किया। यदि ब्याज की दर 10% वार्षिक है और 2 वर्ष के अंत में उसे कुल ₹ 5,150 ब्याज मिला, तो चक्रवृद्धि ब्याज पर निवेश की गई राशि ज्ञात करें।",options:["A) ₹12,500","B) ₹13,800","C) ₹15,000","D) ₹16,000","E) अनुत्तरित प्रश्न"],answer:"C) ₹15,000"},
{id:6632,question:"यदि $A:B=2:3$, $B:C=2:5$ और $A:D=1:2$ तो C:D है:",options:["A) 8:15","B) 15:8","C) 1:1","D) 15:2","E) अनुत्तरित प्रश्न"],answer:"B) 15:8"},
{id:6633,question:"कविता की आयु 40 वर्ष है और शैलजा की आयु 48 वर्ष है। कितने वर्ष बाद उनकी आयु का अनुपात 6:7 होगा ?",options:["A) 6","B) 8","C) 9","D) 10","E) अनुत्तरित प्रश्न"],answer:"B) 8"},
{id:6634,question:"P, Q और R ने समान निवेश के साथ साझेदारी शुरू की। तीन महीने बाद, P ने अपने निवेश की 20% राशि निकाल ली और Q ने अपने निवेश की 50% राशि का और निवेश किया। वर्ष के अंत में उनके लाभांशों में अनुपात ज्ञात करें।",options:["A) 8:15:12","B) 34:55:40","C) 23:25:14","D) 3:3:4","E) अनुत्तरित प्रश्न"],answer:"B) 34:55:40"},
{id:6635,question:"X और Y किसी काम को क्रमशः 6 दिन और 8 दिन में कर सकते हैं। Z की सहायता से, वे इस काम को 3 दिन में कर सकते हैं। Z अकेले उस काम को कितने दिन में कर सकता है?",options:["A) 14","B) 20","C) 18","D) 24","E) अनुत्तरित प्रश्न"],answer:"D) 24"},
{id:6636,question:"पाईपें P, Q और R एक टंकी को क्रमशः 28 मिनट, 35 मिनट तथा 42 मिनट में भर सकती हैं। इन सभी पाइपों को एक साथ खोला गया। गलती से निकासी पाइप भी पाइपों P, Q और R के साथ खोल दी गई। यदि इससे टंकी 12 मिनट में भर सकी, तो कितने मिनट में निकासी पाइप, पूरी भरी हुई टंकी को खाली कर सकती है ?",options:["A) 220","B) 210","C) 200","D) 190","E) अनुत्तरित प्रश्न"],answer:"B) 210"},
{id:6637,question:"एक व्यक्ति 45 km/h की गति से यात्रा करते हुए अपने गंतव्य स्थान पर सही समय पर पहुँचता है। एक दिन वह अपनी यात्रा का केवल आधा भाग ही $\\frac{5}{8}$ समय में तय कर सका। शेष यात्रा में उसकी गति (km/h में) क्या होनी चाहिए जिससे वह सही समय पर गंतव्य स्थान पर पहुँच जाए ?",options:["A) 50","B) 36","C) 52","D) 60","E) अनुत्तरित प्रश्न"],answer:"D) 60"},
{id:6638,question:"दंड आलेख में वर्ष 2024 में 5 कंपनियों J, K, L, M और N द्वारा उत्पादित की गई कलाई घड़ियों की संख्या को दर्शाया गया है।\n\n\n\nकम्पनियों J और N द्वारा मिलाकर उत्पादित कलाई घड़ियों की संख्या का कम्पनियों K, L और M द्वारा मिलाकर उत्पादित घड़ियों की संख्या से अनुपात ज्ञात कीजिए।", image: "https://raw.githubusercontent.com/Dream-Link/4th-Grade-Papers/main/6%2038.png", options:["A) 505:669","B) 506: 669","C) 506:671","D) 507:671","E) अनुत्तरित प्रश्न"],answer:"B) 506: 669"},
{id:6639,question:"राजस्थानी भाषा में काव्य रूप में उपलब्ध संतों का जीवन चरित्र इस प्रकार जाना जाता है:",options:["A) परची","B) रासो","C) रूपक","D) प्रकास","E) अनुत्तरित प्रश्न"],answer:"A) परची"},
{id:6640,question:"कन्हैया ख़याल में कहानी 'कहान' में मुख्य पात्र क्या कहलाता है?",options:["A) मेडिया","B) जोगी-जोगन","C) हीराचंद","D) दुलिया","E) अनुत्तरित प्रश्न"],answer:"A) मेडिया"},
{id:6641,question:"मेवाड़ की पारंपरिक टोपी को क्या कहाँ जाता है?",options:["A) कांचली","B) कुलहा","C) टोपी","D) साफा/पगड़ी","E) अनुत्तरित प्रश्न"],answer:"D) साफा/पगड़ी"},
{id:6642,question:"राजस्थानी संगीत में व्यापक रूप से प्रयुक्त होने वाला निम्नलिखित में से कौन-सा वाद्य एक \"सुषिर वाद्य\" है?",options:["A) कमायचा","B) ढोल","C) पुंगी","D) मोरचंग","E) अनुत्तरित प्रश्न"],answer:"C) पुंगी" , deleted: true},
{id:6643,question:"राजस्थान के निम्नलिखित लोक देवताओं में से किसकी पूजा मुसलमान \"रामशाह-पीर\" के रूप में करते हैं?",options:["A) मल्लिनाथजी","B) गोपाजी","C) रामदेवजी","D) देवनारायणजी","E) अनुत्तरित प्रश्न"],answer:"C) रामदेवजी"},
{id:6644,question:"राजस्थान के निम्नलिखित में से किस क्षेत्र में \"कजली तीज महोत्सव\" विशेष रूप से भव्यता के साथ मनाया जाता है? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) अलवर","B) उदयपुर","C) बूंदी","D) झालावाड़","E) अनुत्तरित प्रश्न"],answer:"C) बूंदी"},
{id:6645,question:"राजस्थान में उस्ता कला निम्नलिखित में से किस शहर की सांस्कृतिक विरासत का एक प्रमुख हिस्सा है?",options:["A) उदयपुर","B) जैसलमेर","C) बीकानेर","D) जयपुर","E) अनुत्तरित प्रश्न"],answer:"C) बीकानेर"},
{id:6646,question:"निम्नलिखित में से कौन राजस्थान राज्य सरकार में सामाजिक न्याय और सशक्तिकरण विभाग के वर्तमान कैबिनेट मंत्री हैं (जून 2025 के अनुसार)?",options:["A) जोराराम कुमावत","B) कन्हैया लाल","C) अविनाश गहलोत","D) मदन दिलावर","E) अनुत्तरित प्रश्न"],answer:"C) अविनाश गहलोत"},
{id:6647,question:"निम्नलिखित में से कौन-सा निकाय राजस्थान में आर टी आई अधिनियम (2005) से संबंधित मामलों के लिए अंतिम अपीलीय प्राधिकारी के रूप में कार्य करता है?",options:["A) सूचना संगठन, राजस्थान","B) राजस्थान राज्य सूचना आयोग","C) राजस्थान राज्य आर.टी.आई. बोर्ड","D) राजस्थान राज्य सूचना परिषद्","E) अनुत्तरित प्रश्न"],answer:"B) राजस्थान राज्य सूचना आयोग"},
{id:6648,question:"निम्नलिखित में से कौन-सी धातु केरोसिन तेल में रखी जाती है?",options:["A) प्लैटिनम","B) सोना","C) ताँबा","D) सोडियम","E) अनुत्तरित प्रश्न"],answer:"D) सोडियम"},
{id:6649,question:"एंजाइम पेप्सिन और ट्रिप्सिन क्रमशः निम्न द्वारा स्रावित होते हैं:",options:["A) आमाशय और लार ग्रंथियाँ","B) आमाशय और अग्न्याशय","C) यकृत और अग्न्याशय","D) यकृत और आमाशय","E) अनुत्तरित प्रश्न"],answer:"B) आमाशय और अग्न्याशय"},
{id:6650,question:"द्विगुणित मानव कोशिकाओं में गुणसूत्रों के कितने जोड़े मौजूद होते हैं?",options:["A) 28","B) 40","C) 23","D) 48","E) अनुत्तरित प्रश्न"],answer:"C) 23"},
{id:6651,question:"सूची I का सूची II से मिलान करें:\nसूची I (मानव रोग)\na. तपेदिक\nb. खसरा (मीज़ल्स)\nc. मलेरिया\nd. दाद (रिंगवर्म)\nसूची II (कारण)\nI. कवक (फंगी)\nII. बैक्टीरिया (जीवाणु)\nIII. वायरस (विषाणु)\nIV. प्रोटोजोआ\nनीचे दिए गए विकल्पों में से सही उत्तर चुनें:",options:["A) a-II, b-III, c-IV, d-I","B) a-II, b-I, c-IV, d-III","C) a-I, b-II, c-IV, d-III","D) a-III, b-I, c-II, d-IV","E) अनुत्तरित प्रश्न"],answer:"A) a-II, b-III, c-IV, d-I"},
{id:6652,question:"नाहरगढ़ किले के मुख्य प्रवेश द्वार का नाम क्या है?",options:["A) हवा द्वार","B) ताड़ी द्वार","C) सूरज पोल","D) सिंह द्वार","E) अनुत्तरित प्रश्न"],answer:"B) ताड़ी द्वार"},
{id:6653,question:"निम्नलिखित में से किसने राजस्थान में गागरोन किले का निर्माण करवाया था?",options:["A) राणा कुम्भा","B) बिजलदेव सिंह","C) जालिम सिंह झाला","D) महाराजा सवाई जय सिंह","E) अनुत्तरित प्रश्न"],answer:"B) बिजलदेव सिंह"},
{id:6654,question:"राजस्थान के करौली क्षेत्र में कैला देवी के भक्तों द्वारा गाए जाने वाले भक्ति गीतों को क्या कहा जाता है?",options:["A) हमसीदो","B) लांगुरिया","C) लालर","D) पनिहारी/पणिहारी","E) अनुत्तरित प्रश्न"],answer:"B) लांगुरिया"},
{id:6655,question:"'वालर नृत्य' राजस्थान के सिरोही क्षेत्र की निम्नलिखित में से किस जनजाति का प्रसिद्ध नृत्य है?",options:["A) भील","B) ढोली","C) गरासिया","D) कामड़","E) अनुत्तरित प्रश्न"],answer:"C) गरासिया"},
{id:6656,question:"निम्नलिखित में से कौन-सा दौसा, लालसोट और सवाई माधोपुर क्षेत्रों का लोक नाट्य है?",options:["A) जयपुरी ख्याल","B) कुचामनी ख्याल","C) हेला ख्याल","D) तुर्रा कलंगी ख्याल","E) अनुत्तरित प्रश्न"],answer:"C) हेला ख्याल"},
{id:6657,question:"निम्नलिखित में से कौन-सा लोकनाट्य महाराजा प्रताप सिंह के शासनकाल के दौरान जयपुर में उत्पन्न हुआ था?",options:["A) रम्मत","B) गवरी","C) तमाशा","D) चार बैंत","E) अनुत्तरित प्रश्न"],answer:"C) तमाशा"},
{id:6658,question:"निम्नलिखित में से कौन-सी प्रसिद्ध हवेली जैसलमेर में स्थित है?",options:["A) रामपुरिया हवेली","B) बागोर की हवेली","C) पटवों की हवेली","D) भामाशाह की हवेली","E) अनुत्तरित प्रश्न"],answer:"C) पटवों की हवेली"},
{id:6659,question:"भारत की संविधान सभा के अध्यक्ष कौन थे? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) डॉ. राजेंद्र प्रसाद","B) गणेश वासुदेव मावलंकर","C) डॉ. बी. आर. अंबेडकर","D) पंडित जवाहरलाल नेहरू","E) अनुत्तरित प्रश्न"],answer:"A) डॉ. राजेंद्र प्रसाद"},
{id:6660,question:"भारत में राज्यों के राज्यपाल के बारे में निम्नलिखित में से कौन-सा कथन सही है? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) किसी राज्य के राज्यपाल का चुनाव राज्य के विधानमंडल के सदस्यों द्वारा किया जाता है।","B) राज्यपाल संसद के किसी भी सदन या किसी राज्य के विधानमंडल के किसी सदन के सदस्य नहीं होंगे।","C) राज्यपाल छह वर्ष की अवधि के लिए पद पर रहेंगे।","D) भारत का कोई भी नागरिक जिसने 30 वर्ष की आयु पूरी कर ली है, राज्यपाल नियुक्त होने के लिए पात्र है।","E) अनुत्तरित प्रश्न"],answer:"B) राज्यपाल संसद के किसी भी सदन या किसी राज्य के विधानमंडल के किसी सदन के सदस्य नहीं होंगे।"},
{id:6661,question:"Choose the most appropriate option to convert the following sentence from Active to Passive Voice:\nHe was passing the ball.",options:["A) The ball is being passed by him.","B) The ball was passed by him.","C) The ball had been passed by him.","D) The ball was being passed by him.","E) Question not attempted"],answer:"D) The ball was being passed by him."},
{id:6662,question:"Choose the most appropriate option to convert the following sentence from Direct to Indirect Speech:\nShe said to me, \"He has submitted the report.\"",options:["A) She said that he has submitted the report.","B) He said that he had submitted the report.","C) She told me that he had submitted the report.","D) She confirmed that his report was submitted.","E) Question not attempted"],answer:"C) She told me that he had submitted the report."},
{id:6663,question:"Convert the following Assertive Sentence to a Negative Sentence:\nLokesh has more wealth than common sense.",options:["A) Lokesh does not have as much common sense as he has wealth.","B) Lokesh does not have wealth and common sense.","C) Lokesh neither has wealth but has common sense.","D) Lokesh is more wealthy than smart.","E) Question not attempted"],answer:"A) Lokesh does not have as much common sense as he has wealth."},
{id:6664,question:"Convert the following Interrogative Sentence to an Assertive Sentence:\nWho does not like to be pampered?",options:["A) Oh to be pampered by everybody!","B) Everybody likes to be pampered.","C) Do you like to be pampered?","D) Everybody shall be pampered.","E) Question not attempted"],answer:"B) Everybody likes to be pampered."},
{id:6665,question:"Convert the following Assertive Sentence to an Exclamatory Sentence:\nIt is sad that we have lost the match today.",options:["A) Bravo! We have lost the match today.","B) Hurrah! We have lost the match today.","C) Alas! We have lost the match today.","D) What a sad match today!","E) Question not attempted"],answer:"C) Alas! We have lost the match today."},
{id:6666,question:"Choose the most appropriate option to correct the following sentence:\nNo sooner I saw the bear than I ran away.",options:["A) No sooner I had seen","B) No sooner had I seen","C) As soon as I saw","D) No correction needed","E) Question not attempted"],answer:"B) No sooner had I seen"},
{id:6667,question:"Fill in the blank with the most appropriate word:\nIt took Anand seven years to ______ this task.",options:["A) accomplice","B) accomplish","C) accompany","D) accompanies","E) Question not attempted"],answer:"B) accomplish"},
{id:6668,question:"'किसान-गिरदावरी' मोबाइल एप्लीकेशन का क्या उपयोग है? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) किसान यहाँ अपनी फसल बेच सकते हैं।","B) किसान अपनी फसल की जानकारी स्वयं पंजीकृत कर सकते हैं।","C) किसान टिड्डियों की आवाजाही पर नज़र रख सकते हैं।","D) किसान बीज और खाद खरीद सकते हैं।","E) अनुत्तरित प्रश्न"],answer:"B) किसान अपनी फसल की जानकारी स्वयं पंजीकृत कर सकते हैं।"},
{id:6669,question:"निम्नलिखित में से कौन-सा ऑपरेटिंग सिस्टम नहीं है?",options:["A) विंडोज 11","B) मैक ओएस","C) एडोब फोटोशॉप","D) उबंटू","E) अनुत्तरित प्रश्न"],answer:"C) एडोब फोटोशॉप"},
{id:6670,question:"माइक्रोसॉफ्ट वर्ड में चयनित टेक्स्ट को हटाने के लिए प्रयुक्त कीबोर्ड शॉर्टकट ______ है।",options:["A) Ctrl+H","B) Ctrl+X","C) Ctrl+V","D) Ctrl+Z","E) अनुत्तरित प्रश्न"],answer:"B) Ctrl+X"},
{id:6671,question:"एमएस एक्सेल में पाई चार्ट और बार ग्राफ ______ टैब के अंतर्गत पाए जाते हैं।",options:["A) इन्सर्ट","B) होम","C) पेज लेआउट","D) फ़ॉर्मूलास","E) अनुत्तरित प्रश्न"],answer:"A) इन्सर्ट"},
{id:6672,question:"______ वेब पेज, इमेज, वीडियो आदि का एक संग्रह है, जो एक URL के सापेक्ष संबोधित होते हैं।",options:["A) वेब ब्राउज़र","B) हाइपरलिंक","C) आईपी एड्रेस","D) वेबसाइट","E) अनुत्तरित प्रश्न"],answer:"D) वेबसाइट"},
{id:6673,question:"______ ई-मेल पते का अनिवार्य हिस्सा नहीं है। (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) उपयोगकर्ता नाम","B) \"@\" का चिह्न","C) प्राप्तकर्ता का नाम","D) शीर्ष स्तरीय डोमेन","E) अनुत्तरित प्रश्न"],answer:"C) प्राप्तकर्ता का नाम"},
{id:6674,question:"$\\frac{5}{3}, \\frac{2}{9}$ और $\\frac{4}{27}$ से पूर्णतः विभाज्य छोटी से छोटी भिन्न ज्ञात करें।",options:["A) 1/3","B) 20/27","C) 20/9","D) 20/3","E) अनुत्तरित प्रश्न"],answer:"D) 20/3"},
{id:6675,question:"किसी परीक्षा में एक कक्षा के 60 विद्यार्थियों के अंकों का औसत 43 है। उत्तीर्ण विद्यार्थियों के अंकों का औसत 52 है तथा अनुत्तीर्ण विद्यार्थियों के अंकों का औसत 16 है। कक्षा में अनुत्तीर्ण विद्यार्थियों का प्रतिशत क्या है?",options:["A) 33 1/3%","B) 15%","C) 36%","D) 25%","E) अनुत्तरित प्रश्न"],answer:"D) 25%"},
{id:6676,question:"एक दुकानदार ने एक वस्तु ₹ 2,016 में बेची, जिससे उसे 12% लाभ हुआ। 20% लाभ प्राप्त करने के लिए उसे वह वस्तु कितने में बेचनी चाहिए थी ?",options:["A) ₹2,177.28","B) ₹2,165","C) ₹2,160","D) ₹2,154","E) अनुत्तरित प्रश्न"],answer:"C) ₹2,160"},
{id:6677,question:"एक विक्रेता ने दो पुरानी बाइकें प्रत्येक ₹ 18,000 में बेची। एक बाइक पर उसे 20% लाभ हुआ और दूसरी पर उसे 10% हानि हुई। इस सम्पूर्ण लेनदेन में उसे हुआ लाभ अथवा हानि प्रतिशत ज्ञात करें।",options:["A) लाभ, 10%","B) लाभ, 2 6/7","C) हानि, 2 1/4","D) लाभ, 2 1/2","E) अनुत्तरित प्रश्न"],answer:"B) लाभ, 2 6/7"},
{id:6678,question:"यदि किसी वर्ग की प्रत्येक भुजा को 20% बढ़ाया जाए, तो वर्ग के क्षेत्रफल में वृद्धि प्रतिशत है :",options:["A) 40%","B) 42%","C) 44%","D) 50%","E) अनुत्तरित प्रश्न"],answer:"C) 44%"},
{id:6679,question:"साधारण ब्याज पर एक निश्चित धनराशि 5 वर्ष में ₹ 13,080 और 8 वर्ष में ₹ 16,023 हो जाती है। ब्याज की वार्षिक दर है:",options:["A) 8%","B) 9%","C) 11%","D) 12%","E) अनुत्तरित प्रश्न"],answer:"D) 12%"},
{id:6680,question:"निम्नलिखित में से कौन-सा शब्द व्यक्तिवाचक संज्ञा का उदाहरण नहीं है?",options:["A) भारत","B) गंगा","C) पहाड़","D) हिमालय","E) अनुत्तरित प्रश्न"],answer:"C) पहाड़"},
{id:6681,question:"\"यह बिल्ली काली है\" वाक्य में किस विशेषण का प्रयोग हुआ है?",options:["A) गुणवाचक विशेषण","B) संख्यावाचक विशेषण","C) व्यक्तिवाचक विशेषण","D) परिमाणवाचक विशेषण","E) अनुत्तरित प्रश्न"],answer:"A) गुणवाचक विशेषण"},
{id:6682,question:"निम्नलिखित में से किस वाक्य में संबंधवाचक सर्वनाम का प्रयोग हुआ है ?",options:["A) मैं आप चला जाऊँगा","B) जो सोता है, सो खोता है","C) मुझे कुछ दे दो","D) वह जंगली गाय है","E) अनुत्तरित प्रश्न"],answer:"B) जो सोता है, सो खोता है"},
{id:6683,question:"\"राधेश्याम रो चुका।\" वाक्य में किस प्रकार की क्रिया का प्रयोग हुआ है ?",options:["A) यौगिक क्रिया","B) संयुक्त क्रिया","C) सकर्मक क्रिया","D) प्रेरणार्थक क्रिया","E) अनुत्तरित प्रश्न"],answer:"B) संयुक्त क्रिया"},
{id:6684,question:"निम्नलिखित शब्दों में से तत्सम शब्द हैं:\na. गोबर\nb. उष्ट्र\nc. पलंग\nd. मयूर\ne. फूल\nनीचे दिये गए विकल्पों में से सबसे उपयुक्त उत्तर का चयन कीजिए:",options:["A) केवल a और b","B) केवल d और e","C) केवल a और c","D) केवल b और d","E) अनुत्तरित प्रश्न"],answer:"D) केवल b और d"},
{id:6685,question:"नीचे दो कथन दिए गए हैं-\nकथन I: जो शब्द संस्कृत और प्राकृत से विकृत होकर हिन्दी में आए हैं, वे तद्भव कहलाते हैं।\nकथन II: विदेशी भाषाओं से हिन्दी भाषा में आए शब्दों को तद्भव कहते हैं।\nउपरोक्त कथनों के आलोक में, नीचे दिये गए विकल्पों में से सबसे उपयुक्त उत्तर का चयन कीजिए:",options:["A) कथन I और कथन II दोनों सही हैं।","B) कथन I और कथन II दोनों ग़लत हैं।","C) कथन I सही है लेकिन कथन II ग़लत है।","D) कथन I ग़लत है लेकिन कथन II सही है।","E) अनुत्तरित प्रश्न"],answer:"C) कथन I सही है लेकिन कथन II ग़लत है।"},
{id:6686,question:"निम्नलिखित में से देशज शब्द है-",options:["A) शत","B) तिक्त","C) लोटा","D) क्षीर","E) अनुत्तरित प्रश्न"],answer:"C) लोटा"},
{id:6687,question:"'अक्ल पर पत्थर पड़ना' मुहावरे का अर्थ है-",options:["A) बुद्धि भ्रष्ट हो जाना","B) बहुत परिश्रम करना","C) मरणासन्न होना","D) साथ मिलकर न रहना","E) अनुत्तरित प्रश्न"],answer:"A) बुद्धि भ्रष्ट हो जाना"},
{id:6688,question:"'कम गुणी होकर भी गुणी का दिखावा' निम्नलिखित में से किस लोकोक्ति का अर्थ है ?",options:["A) थोथा चना बाजे घना","B) अंधों में काना राजा","C) आम के आम गुठलियों के दाम","D) अंधे के हाथ बटेर लगना","E) अनुत्तरित प्रश्न"],answer:"A) थोथा चना बाजे घना"},
{id:6689,question:"'नयन' का संधि-विच्छेद होगा-",options:["A) नय + अन","B) ने + अन","C) नय् + न","D) न + अन","E) अनुत्तरित प्रश्न"],answer:"B) ने + अन"},
{id:6690,question:"'प्रत्युपकार' शब्द में प्रयुक्त उपसर्ग है -",options:["A) प्र","B) प्रति","C) प्रत्यु","D) प्रत्","E) अनुत्तरित प्रश्न"],answer:"B) प्रति"},
{id:6691,question:"राजस्थान के निम्नलिखित में से किस क्षेत्र में \"परवन बहुउद्देशीय सिंचाई परियोजना\" मुख्य रूप से स्थित है?",options:["A) झालावाड़","B) बीकानेर","C) बाड़मेर","D) सिरोही","E) अनुत्तरित प्रश्न"],answer:"A) झालावाड़"},
{id:6692,question:"2024 में मानसून सीजन (जून-सितंबर) के दौरान किस महीने में राजस्थान में दीर्घावधि औसत (एलपीए) वर्षा का उच्चतम प्रतिशत दर्ज किया गया? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) सितंबर","B) जुलाई","C) जून","D) अगस्त","E) अनुत्तरित प्रश्न"],answer:"D) अगस्त"},
{id:6693,question:"राजस्थान में \"हमजा खेरी बाँध\" किस नदी पर बनाया गया है?",options:["A) सिवनी","B) बनास","C) चम्बल","D) बाणगंगा","E) अनुत्तरित प्रश्न"],answer:"A) सिवनी"},
{id:6694,question:"निम्नलिखित में से कौन-सा बाँध राजस्थान के उदयपुर क्षेत्र में स्थित नहीं है?",options:["A) बड़गांव बाँध","B) बागोलिया बाँध","C) फतेह सागर बाँध","D) माशी बाँध","E) अनुत्तरित प्रश्न"],answer:"D) माशी बाँध"},
{id:6695,question:"जनगणना 2011 के अनुसार राजस्थान के किस ज़िले में जनसंख्या का दूसरा सबसे अधिक घनत्व दर्ज किया गया?",options:["A) अजमेर","B) बीकानेर","C) भरतपुर","D) बूंदी","E) अनुत्तरित प्रश्न"],answer:"C) भरतपुर"},
{id:6696,question:"बनास नदी कुंभलगढ़ के निकट ______ नामक स्थान से निकलती है।",options:["A) नाग पहाड़","B) वेरों का मठ","C) दुर्ग","D) शिवालिक","E) अनुत्तरित प्रश्न"],answer:"B) वेरों का मठ"},
{id:6697,question:"निम्नलिखित में से कौन-सा राष्ट्रीय राजमार्ग राजस्थान से होकर गुजरता है, जैसा कि एनएचएआई द्वारा 31-12-2024 की स्थिति में जारी भारत के सड़क नेटवर्क के राज्य/केंद्र शासित प्रदेशवार विवरण में दर्शाया गया है?",options:["A) 216A","B) 315A","C) 702D","D) 168A","E) अनुत्तरित प्रश्न"],answer:"D) 168A"},
{id:6698,question:"कोटा बाईपास पर चंबल नदी पर बना केबल स्टेड ब्रिज निम्नलिखित में से किस राष्ट्रीय कॉरिडोर (गलियारा) का हिस्सा है? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) पूर्व-पश्चिम कॉरिडोर","B) उत्तर-दक्षिण कॉरिडोर","C) दक्षिण-पूर्व कॉरिडोर","D) पूर्व-उत्तर कॉरिडोर","E) अनुत्तरित प्रश्न"],answer:"A) पूर्व-पश्चिम कॉरिडोर"},
{id:6699,question:"भारत में राष्ट्रीय आपदा प्रबंधन प्राधिकरण (एन डी एम ए) का नेतृत्व करता है:",options:["A) राष्ट्रपति","B) केंद्रीय गृह मंत्री","C) प्रधान मंत्री","D) कैबिनेट सचिव","E) अनुत्तरित प्रश्न"],answer:"C) प्रधान मंत्री"},
{id:6700,question:"राजस्थान में \"जलवायु परिवर्तन एवं स्वच्छ विकास तंत्र (सी डी एम) प्रकोष्ठ\" की स्थापना किस विभाग के तहत की गई?",options:["A) राज्य आयोजन विभाग","B) राजस्थान राज्य प्रदूषण नियंत्रण बोर्ड","C) वन विभाग","D) राजस्थान अक्षय ऊर्जा निगम","E) अनुत्तरित प्रश्न"],answer:"B) राजस्थान राज्य प्रदूषण नियंत्रण बोर्ड"},
{id:6701,question:"Fill in the blank with the most appropriate article:\nHe earns seventy thousand rupees ______ year.",options:["A) a","B) the","C) an","D) Not applicable","E) Question not attempted"],answer:"A) a"},
{id:6702,question:"Fill in the blank with the most appropriate option:\nDo you have ______ food left?",options:["A) a few","B) any","C) a","D) little","E) Question not attempted"],answer:"B) any"},
{id:6703,question:"Match List-I with List-II:\nList-I (Sentences)\na. Prem was sentenced __ death by the Judge.\nb. For lack __ money, he could not continue his education.\nc. The cat jumped __ the fence.\nd. The doctor decided to operate __ his arm immediately.\nList-II (Preposition)\nI. over\nII. on\nIII. of\nIV. to\nChoose the correct answer from the options provided:",options:["A) a-I,b-IV, c-II, d-III","B) a-III, b-I, c-IV, d-II","C) a-IV,b-II, c-III, d-I","D) a-IV,b-III, c-I, d-II","E) Question not attempted"],answer:"D) a-IV,b-III, c-I, d-II"},
{id:6704,question:"Choose the sentence with the most appropriate use of punctuation.",options:["A) I think you're, wrong Jonty.","B) Bring me, some fruit Priya.","C) It is cloudy? It may rain.","D) They will come, won't they?","E) Question not attempted"],answer:"D) They will come, won't they?"},
{id:6705,question:"Choose the most appropriate option to transform the given sentence from Hindi to English:\nइस कक्षा में तान्या दूसरों से ज्यादा समयनिष्ठ है।",options:["A) Tanya is sharper than anybody else in the class.","B) Tanya is more punctual than others in the class.","C) Tanya is never on time in her other class.","D) Tanya is otherwise the most punctual girl in every class.","E) Question not attempted"],answer:"B) Tanya is more punctual than others in the class."},
{id:6706,question:"Choose the most appropriate option to transform the following sentence from English to Hindi:\nShe listened to my advice attentively.",options:["A) उसने मेरी सलाह ध्यानपूर्वक सुनी।","B) वो सतर्कता से मेरी सुलह सुन रही थी।","C) उसने मेरी सलाह सुनने में सतर्कता दिखाई।","D) मेरी सलाह सतर्कता से सुनी गई।","E) Question not attempted"],answer:"A) उसने मेरी सलाह ध्यानपूर्वक सुनी।"},
{id:6707,question:"What is the technical term for a document which is genuine?",options:["A) Domicile (अधिवास)","B) Evacuation (निकास)","C) Bona-fide (प्रामाणिक)","D) Constitution (संविधान)","E) Question not attempted"],answer:"C) Bona-fide (प्रामाणिक)"},
{id:6708,question:"निम्नलिखित में से राजस्थान का कौन-सा स्थान अंतर्राष्ट्रीय सीमा के सबसे करीब है?",options:["A) फलोदी","B) पोखरण","C) तनोट","D) किशनगढ़","E) अनुत्तरित प्रश्न"],answer:"C) तनोट" , deleted: true},
{id:6709,question:"निम्नलिखित में से राजस्थान का कौन-सा क्षेत्र हरियाणा से अपनी सीमा साझा नहीं करता है? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) हनुमानगढ़","B) दौसा","C) सीकर","D) अलवर","E) अनुत्तरित प्रश्न"],answer:"B) दौसा"},
{id:6710,question:"भारत की जनगणना (2011) के अनुसार, राजस्थान की शहरी जनसंख्या (राज्य की कुल जनसंख्या के संबंध में) लगभग कितना प्रतिशत थी? (निम्न में से सबसे उपयुक्त विकल्प चुनें)",options:["A) 25%","B) 40%","C) 38%","D) 42%","E) अनुत्तरित प्रश्न"],answer:"A) 25%"},
{id:6711,question:"'ज़हरीला' शब्द में कौन-सा प्रत्यय होगा?",options:["A) ईला","B) रीला","C) ला","D) ज़हर","E) अनुत्तरित प्रश्न"],answer:"A) ईला"},
{id:6712,question:"निम्नलिखित में से 'आँख' का पर्यायवाची नहीं है-",options:["A) चक्षु","B) दृग","C) लोचन","D) चपला","E) अनुत्तरित प्रश्न"],answer:"D) चपला"},
{id:6713,question:"'पक्षपात' शब्द का विलोम शब्द होगा-",options:["A) अभद्र","B) स्वच्छ","C) निष्पक्ष","D) सापेक्ष","E) अनुत्तरित प्रश्न"],answer:"C) निष्पक्ष"},
{id:6714,question:"'जो बहुत जानता है' वाक्यांश के लिए उचित शब्द होगा -",options:["A) बहुज्ञ","B) अज्ञ","C) कृतज्ञ","D) क्षम्य","E) अनुत्तरित प्रश्न"],answer:"A) बहुज्ञ"},
{id:6715,question:"निम्नलिखित में से शुद्ध शब्द का चयन कीजिए:",options:["A) शारिरीक","B) पारिवारीक","C) चारित्रिक","D) प्रसंशनीय","E) अनुत्तरित प्रश्न"],answer:"C) चारित्रिक"},
{id:6716,question:"निम्नलिखित वाक्यों में से शुद्ध वाक्य का चयन कीजिएः",options:["A) तेरे को आज घर में ही खेलना हैं।","B) मैं गाने का अभ्यास कर रहा हूँ।","C) आपका भवदीय।","D) थोड़ी देर बाद वे वापस लौट आए।","E) अनुत्तरित प्रश्न"],answer:"B) मैं गाने का अभ्यास कर रहा हूँ।"},
{id:6717,question:"\"प्रज्ञा ने पाठ पढ़ा होगा।\" वाक्य किस काल से संबंधित है?",options:["A) संदिग्ध भूतकाल","B) सामान्य भूतकाल","C) आसन्न भूतकाल","D) पूर्ण भूतकाल","E) अनुत्तरित प्रश्न"],answer:"A) संदिग्ध भूतकाल"},
{id:6718,question:"रमेश ने अपने भाई के द्वारा आप का खोया हुआ बैग भिजवा दिया है। आपने आभार प्रकट करते हुए रमेश को पत्र लिखा। यह पत्र किस शैली (प्रकार) के अन्तर्गत होगा?",options:["A) औपचारिक पत्र","B) परिपत्र","C) अनुस्मारक पत्र","D) अनौपचारिक पत्र","E) अनुत्तरित प्रश्न"],answer:"D) अनौपचारिक पत्र"},
{id:6719,question:"भारत सरकार ने दिल्ली के शिक्षा विभाग को 15 दिन पहले एक पत्र भेजा था। जिसका उत्तर प्राप्त न होने पर उन्होंने Reminder भेजा। 'Reminder'- शब्द के लिए उचित हिन्दी शब्द है:",options:["A) अधिसूचना","B) अनुस्मारक","C) ज्ञापन","D) कार्यालय आदेश","E) अनुत्तरित प्रश्न"],answer:"B) अनुस्मारक"},
{id:6720,question:"Fill in the blank in the following sentence with the most appropriate tense form:\nThe radio ______ since 10 p.m. yesterday. The neighbours were getting disturbed because of it.",options:["A) would play","B) had been playing","C) plays","D) have had played","E) Question not attempted"],answer:"B) had been playing"}
